import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useEffect } from "react";
import { Button } from "react-bootstrap";
import React from "react";
import Table from "react-bootstrap/Table";
import userSession from "../../Service/userSession";
import OrderAPIService from "../../Service/OrderAPIService";

const OrderHistory = ({ isLoggedIn }) => {
  const navigate = useNavigate();
  const [orders, setOrders] = useState(null);

  useEffect(() => {
    if (!isLoggedIn) {
      navigate("/");
    } else {
      document.title = "History";
    }
  }, []);

  useEffect(() => {

  }, [input]);

  const toHomePage = () => {
    navigate("/");
  };

  const fetchOrders = () => {
    console.log("user id :: "+userSession.getUser().id);
    OrderAPIService.orderHistory({ id: userSession.getUser().id })
      .then((response) => {
        if (response.status == 200) {
          setOrders(response.data);
        } else {
          setOrders(null);
        }
      })
      .catch((err) => {
        console.log(err);
        setOrders(null);
      });
  };

  const noHistory = () => {
    return (
      <section
        className="md-primary"
        style={{ fontFamily: "Signika", padding: "64px 32px" }}
      >
        <div
          className="container text-center"
          style={{
            marginRight: "auto",
            marginBottom: "340px",
            marginLeft: "auto",
          }}
        >
          <div style={{ marginTop: "40px" }}>
            {/* Image */}
            <img
              className="img-fluid"
              src={require("../../Resources/Vector/noHistory.png")}
              style={{ height: "60%", width: "50%" }}
            />
            {/* Help Text */}
            <div style={{ marginTop: "" }}>
              <p
                className=""
                style={{
                  fontSize: "2.5vw",
                  marginTop: "8.5vh",
                  marginBottom: "6.5vh",
                }}
              >
                Uh-Oh! Looks like you don't have any orders yet! Try our meals
                now!
              </p>

              {/* Order Button */}
              <div className="h-100 d-flex align-items-center justify-content-center">
                <Link to="/order">
                  <Button
                    variant="secondary"
                    className="text-primary"
                    style={{
                      height: "50px",
                      width: "150px",
                      borderRadius: "25px",
                      fontSize: "25px",
                    }}
                  >
                    Order
                  </Button>
                </Link>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  };

  const history = () => {
    orders.map((order) => {
      console.log("SINGLE:: " + JSON.stringify(order));
    });
    return (
      <section
        className="bg-primary"
        style={{ fontFamily: "Signika", padding: "20% 32px" }}
      >
        <Table striped bordered hover style={{ fontSize: "calc(16px+1vw)" }}>
          <thead>
            <tr>
              <th>Meal Size</th>
              <th>Types of Meals</th>
              <th>Price</th>
              <th>Date Ordered</th>
              <th>Delivery Date</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((order) => {
              const {
                OrderId,
                deliveryDate,
                totalPrice,
                mealSize,
                orderDate,
                meals,
              } = order;
              return (
                <tr>
                  <td>{mealSize}</td>
                  <td>
                    {meals.map((meal) => {
                      return (
                        <span>
                          {meal.name}
                          <br></br>
                        </span>
                      );
                    })}
                  </td>
                  <td>{totalPrice}</td>
                  <td>{orderDate}</td>
                  <td>{deliveryDate}</td>
                </tr>
              );
            })}
          </tbody>
        </Table>

        <div className="mt-4">
          If you would like to cancel your order, please email
          support@mirchimeals.com before 3pm the prior day of delivery.
        </div>
      </section>
    );
  };

  const viewOrderHistoryPage = () => {
    // fetchOrders();
    if (orders) {
      if (orders.length === 0) {
        return noHistory();
      } else {
        return history();
      }
    } else {
      return <div>Loading... </div>;
    }
  };
  return <>{isLoggedIn ? viewOrderHistoryPage() : toHomePage()}</>;
};

export default OrderHistory;
